import React, { useState } from 'react';
import { Line, Bar, Scatter } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  BarElement,
  Title,
  Tooltip,
  Legend
);

const cricketData = [
  ['Virat Kohli', 140, 2184, 850, 336, 113],
  ['Rohit Sharma', 77, 4850, 247, 414, 97],
  ['MS Dhoni', 95, 4929, 111, 95, 109],
  ['AB de Villiers', 72, 4244, 848, 400, 50],
  ['Chris Gayle', 71, 4725, 912, 413, 39],
];

const columnHeaders = ['Player', 'TotalMatches', 'TotalRuns', 'Total4s', 'Total6s', 'TotalWickets'];

const InferentialStatisticsVisualiser = () => {
  const [selectedCategory, setSelectedCategory] = useState('runs');

  const playerNames = cricketData.map((row) => row[0]);
  const matches = cricketData.map((row) => row[1]);
  const runs = cricketData.map((row) => row[2]);
  const fours = cricketData.map((row) => row[3]);
  const sixes = cricketData.map((row) => row[4]);
  const wickets = cricketData.map((row) => row[5]);

  const options = {
    responsive: true,
    maintainAspectRatio: false,
    plugins: {
      legend: {
        position: 'top',
      },
    },
  };

  // Bar Chart for Runs
  const runsData = {
    labels: playerNames,
    datasets: [
      {
        label: 'Total Runs',
        data: runs,
        backgroundColor: 'rgba(75, 192, 192, 0.5)',
      },
    ],
  };

  // Bar Chart for Fours and Sixes
  const boundariesData = {
    labels: playerNames,
    datasets: [
      {
        label: 'Total Fours',
        data: fours,
        backgroundColor: 'rgba(153, 102, 255, 0.5)',
      },
      {
        label: 'Total Sixes',
        data: sixes,
        backgroundColor: 'rgba(255, 159, 64, 0.5)',
      },
    ],
  };

  // Line Chart for Wickets
  const wicketsData = {
    labels: playerNames,
    datasets: [
      {
        label: 'Total Wickets',
        data: wickets,
        borderColor: 'rgba(255, 99, 132)',
        tension: 0.4,
      },
    ],
  };

  const renderCharts = () => {
    if (selectedCategory === 'runs') {
      return (
        <div className="bg-white p-6 rounded-lg shadow">
          <h2 className="text-xl font-bold mb-4">Total Runs by Player</h2>
          <div style={{ height: '300px' }}>
            <Bar data={runsData} options={options} />
          </div>
        </div>
      );
    } else if (selectedCategory === 'boundaries') {
      return (
        <div className="bg-white p-6 rounded-lg shadow">
          <h2 className="text-xl font-bold mb-4">Fours and Sixes by Player</h2>
          <div style={{ height: '300px' }}>
            <Bar data={boundariesData} options={options} />
          </div>
        </div>
      );
    } else if (selectedCategory === 'wickets') {
      return (
        <div className="bg-white p-6 rounded-lg shadow">
          <h2 className="text-xl font-bold mb-4">Total Wickets by Player</h2>
          <div style={{ height: '300px' }}>
            <Line data={wicketsData} options={options} />
          </div>
        </div>
      );
    }
  };

  return (
    <div className="max-w-4xl mx-auto p-6 space-y-6">
      <div className="text-center space-y-4">
        <h1 className="text-2xl font-bold">Cricket Statistics Visualization</h1>
        <select
          value={selectedCategory}
          onChange={(e) => setSelectedCategory(e.target.value)}
          className="px-4 py-2 border rounded-md"
        >
          <option value="runs">Total Runs</option>
          <option value="boundaries">Fours and Sixes</option>
          <option value="wickets">Total Wickets</option>
        </select>
      </div>

      {renderCharts()}
    </div>
  );
};

export default InferentialStatisticsVisualiser;
